import React from 'react';
import Navbar from '../components/Navbar';
import SlidingImageBanner from '../components/SlidingImageBanner';
import Footer from '../components/Footer';

function Home(){
  return (
    <>
      <Navbar />
      <div>
        <h1>Welcome to Keja Yangu</h1>
        <SlidingImageBanner />
      </div>
      <br></br>
      <br></br>
      <h1 style={{textAlign:"center",}}>Welcome to MyCrib</h1>
      <p style={{textAlign:"center"}}>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Donec tempor consequat lobortis. Morbi ac diam at nibh sodales laoreet. Cras id fringilla lacus. Integer dapibus at neque at facilisis. Fusce ultricies mattis tincidunt. Curabitur id convallis neque, ut mattis orci. Nulla nec felis ut eros eleifend bibendum. Maecenas lectus leo, viverra interdum euismod sed, imperdiet a nibh. Sed ac orci pretium, finibus velit id, venenatis nulla. Vestibulum porta vel tellus et varius. Vivamus id dignissim velit. In posuere velit nec hendrerit imperdiet. Praesent et egestas purus.</p>

      <p style={{textAlign:"center"}}>Suspendisse iaculis eros eget leo fermentum, id euismod tortor iaculis. Nam metus massa, sodales sed arcu ornare, varius ornare nisl. Fusce sed cursus est. Maecenas gravida mi dui, tristique egestas sapien vehicula id. Nunc vel pharetra enim. Maecenas erat lacus, dictum aliquet pulvinar ut, mollis sit amet mi. Aenean eleifend ac libero in consectetur. Phasellus nec tortor ut metus malesuada posuere non vulputate dui. Vivamus mollis risus nec sem dapibus egestas. Nam luctus sed risus eu eleifend. Duis non congue dui. Quisque lobortis ligula turpis, et auctor dui faucibus at.</p>

      <Footer />

    </>
  );
};

export default Home;
